import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { HashRouter, BrowserRouter as Router, Route, Switch } from "react-router-dom";

ReactDOM.render(
    <HashRouter >
        <App></App>
    </HashRouter>
    , document.getElementById("root"));
